CREATE TABLE Client(
   client_id      VARCHAR(6) NOT NULL PRIMARY KEY
  ,client_name    VARCHAR(25) NOT NULL
  ,date_of_birth  DATE  NOT NULL
  ,mobile         VARCHAR(34) NOT NULL
  ,email          VARCHAR(35) NOT NULL
  ,level_of_study VARCHAR(15) NOT NULL
  ,CONSTRAINT client_chk_mobile  CHECK (REGEXP_LIKE(mobile, '^(01[(2-90)]-\d{7})$|^(011-\d{8})$'))
  ,CONSTRAINT client_chk_email   CHECK (REGEXP_LIKE(email,'^[a-zA-Z]\w+@(\S+)$'))
);


